import React from 'react';
import './App.css';
import Contact1 from './Contact1';
function App() {
  return (
    <div>
      <Contact1 
        avatarUrl="https://via.placeholder.com/150"
        name="Jenny Han"
        email="jenny.han@notreal.com"
        age={25}/>
      <Contact1 
        avatarUrl="https://via.placeholder.com/150"
        name="Paul Jones"
        email="paul.jones@notreal.com"
        age={55}/>
      <Contact1 
        avatarUrl="https://via.placeholder.com/150"
        name="Peter Pan"
        email="peter.pan@neverland.com"
        age={100}/>
    </div>

  );
}

export default App;
